import React, { Component } from 'react';

export default class PersonalDetailsForm extends Component{
    render(){
        return(
            <div>
                <h2>Personal Details Page</h2>
                <form onSubmit={this.props.onSubmit}>
                    <label>First Name: </label>
                    <input type="text" name="firstname" onChange={this.props.onChange}/>
                    <label>Last Name: </label>
                    <input type="text" name="lastname" onChange={this.props.onChange}/>
                    <input type="submit" value="Submit"/>
                </form>
            </div>
        );
    }
}
